import {
    Card, CardImg, CardText, CardBody,
    CardTitle, CardSubtitle, Button, ListGroup, ListGroupItem
  } from 'reactstrap';


  
class CD extends Component {
  constructor() {
    super();
    this.state = {
      name: "React",
      accounts:[{
        id:0,
        name:'dog'
      },
      {
        id:1,
        name:'cat'
      },
      {
        id:2,
        name:'mouse'
      }
    ]
    };
  }
  
  componentDidMount(){
    //This function is called when the page loads
    //fetch to load the accounts

    //call fetch
    //pass token and get the cd accounts
    //store it into the accounts state
  }

  render() {
    let accountdata = this.state.accounts.map( data => {
      return(<div>
        {data.id} and {data.name}
      </div>);
    })
    return (
     <div> testing CD 

       <p>
         <Button>Create Account</Button>
       </p>
       <p>
         {accountdata}
       </p>
     </div>
    );
  }
}
export default CD;
